START TRANSACTION;

CREATE DATABASE acme;

USE acme;

CREATE TABLE `groupe` ( 
  `id` INT AUTO_INCREMENT NOT NULL,
  `nom` TEXT NULL,
   PRIMARY KEY (`id`)
);

CREATE TABLE `employee` (
  `id` INT AUTO_INCREMENT NOT NULL,
  `first_name` VARCHAR(250),
  `lastName` VARCHAR(250),
  `email` VARCHAR(250) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL,
  `group_id` INT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_first_name` (`first_name`),
  KEY `idx_lastName` (`lastName`),
  KEY `idx_email` (`email`),
  KEY `idx_group_id` (`group_id`)
) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci;

ALTER TABLE `employee` ADD CONSTRAINT `fk_employee_group` FOREIGN KEY (`group_id`) REFERENCES `groupe` (`id`);

CREATE TABLE `BADGE` (
  `id` INT AUTO_INCREMENT NOT NULL,
  `serial_number` VARCHAR(250) NOT NULL,
  `employee_id` INT NULL,
   PRIMARY KEY (`id`),
  KEY `idx_serial_number` (`serial_number`),
  KEY `idx_employee_id` (`employee_id`)
);
ALTER TABLE `BADGE` ADD CONSTRAINT `fk_badge_employee` FOREIGN KEY (`employee_id`) REFERENCES `employee` (`id`);

CREATE TABLE `extra_info` (
  `id` INT AUTO_INCREMENT NOT NULL,
  `notes` TEXT,
  PRIMARY KEY (`id`)
);

CREATE TABLE `employee_extra_info` (
  `id` TINYINT AUTO_INCREMENT NOT NULL,
  `employee_id` INT NOT NULL,
  `extra_info_id` INT NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uq_employee_id` (`employee_id`),
  FOREIGN KEY (`employee_id`) REFERENCES `employee` (`id`),
  FOREIGN KEY (`extra_info_id`) REFERENCES `extra_info` (`id`)
);

COMMIT;

